// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract fire {

    string public name = "Fire V1";
    string[]  public _flames;
    string[]  public _fees;
    uint256[]  public _fees2;
    address[]  public _flames2;

    mapping(string=>address) public _flame;
    mapping(address=>string) public _operator2flame;
    mapping(string=>uint256) public _fee;
    mapping(address=>bool) public _isadmin;
    mapping(address=>bool) public _isContract;
    mapping(string=>bool) public _istag;

    constructor(){
        _isadmin[msg.sender] = true;
    }
    function setflames(string[] memory flame_, address[] memory contract_, bool[] memory isCon_) public {

        require(_isadmin[msg.sender], 'not approved');
        for (uint256 i = 0; i < flame_.length; ++i) {
            _flame[flame_[i]] = contract_[i];
            if(isCon_[i]){
                _isContract[contract_[i]] = true;
            }
        }
    }
    function setflame(string memory flame_, address contract_, bool isCon_) public {
      require(_isadmin[msg.sender], 'not approved');
      _flame[flame_] = contract_;
      if(isCon_){
        _isContract[contract_] = true;
      }
    }
    function settag(string[] memory tag_) public{
        require(_isadmin[msg.sender], 'not approved');
        for (uint256 i = 0; i < tag_.length; ++i) {
            _istag[tag_[i]] = true;
        }
    }
    function stag(string memory tag_, bool value_) public {
        require(_isadmin[msg.sender], 'not approved');
        _istag[tag_] = value_;

    }
    function gtag(string memory tag_) public view returns(bool){
        return _istag[tag_];
    }
    function setfee(string[] memory fee_, uint256[] memory value_) public {
        require(_isadmin[msg.sender], 'not approved');
        for (uint256 i = 0; i < fee_.length; ++i) {
            _fee[fee_[i]] = value_[i];
        }
    }
    function getfee(string memory fee_) public view returns(uint256){
        return(_fee[fee_]);
    }
    function gflame(string memory flame_) public view returns(address){
        return _flame[flame_];
    }
    function getContract(address caller_) public view returns(bool){
        return _isContract[caller_];
    }

    function setadmin(address admin_, bool value_) public {
        require(_isadmin[msg.sender], 'not approved');
        _isadmin[admin_] = value_;
    }
    function setcontract(address contract_, bool value_) public {
        require(_isadmin[msg.sender], 'not approved father12');
        _isContract[contract_] = value_;
    }
    function getadmin(address admin_) public view returns(bool){
        return _isadmin[admin_];
    }
}
